import React, { useState, useEffect } from "react";
import { useDrag } from "react-dnd";
import Avatar from "@mui/material/Avatar";
import Card from "@mui/material/Card";
import CardHeader from "@mui/material/CardHeader";
import CardMedia from "@mui/material/CardMedia";
import CardContent from "@mui/material/CardContent";
import Typography from "@mui/material/Typography";
import { red } from "@mui/material/colors";
import Alliance from "./Alliance";
import { useDrop } from "react-dnd";
const alliances = useSelector((state) => state.alliances);
console.log(alliances);

const [{ isOver }, drop, DropTarget] = useDrop(() => ({
  accept: "employee",
  drop: (item) => addEmployeeToTeam(DropTarget),
  collect: (monitor) => ({
    isOver: !!monitor.isOver(),
  }),
}));
const addEmployeeToTeam = (item) => {
  console.log(item, "IDL ");
};
function Employee({ employee: employee }) {
  return (
    <Card
      sx={{ maxWidth: 250, maxHeight: 300, marginTop: 2.5 }}
      key={employee.id}
    >
      <CardHeader
        avatar={<Avatar sx={{ bgcolor: red[500] }}>{employee.Name[0]}</Avatar>}
        title={employee.Name}
        subheader={employee.JobTitle}
      />
      <CardMedia
        component="img"
        image={employee["Avatar"]["url"]}
        alt="employee image"
      />
      <CardContent>
        <Typography variant="body2" color="text.secondary">
          {employee.Email}
        </Typography>
      </CardContent>
    </Card>
  );
}

export default Employee;
